    <nav>
      <div className="flex flex-row justify-between">

        <NavLink></NavLink>
        <img src="" alt="" />
        
        <div>
          <p>Home</p>
          <FaShoppingCart/>

        </div>
        
      </div>
    </nav>
  )
};

export default Navbar;
